import sweets from '../../'

export default function New() {

    const [sweets, setSweets] = useState([
        {
            name: '',
            title: '',
            img: ''
        },
        {
            name: '',
            title: '',
            img: ''
        },
        {
            name: '',
            title: '',
            img: ''
        }
    ])

    const HelwNashef = [
        'معمول تمر',
        'معمول جوز',
        'معمول فستق',
        'سنيورة غريبة',
        'بيتي فور'
    ]
    const راحة = [
        'أصابع',
        'جوز الهند',
        'شوكولا',
        'قروش',
        'ليرات',
        'مبرومة',
        'مثلثات',
        'ملوكية حزوز',
        'ملوكية مبرومة',
        'ملوكية مستطيل',
        'ورود'
    ]


    return (
        <div className= 'container'>

      {HelwNashef.map()}

        </div>
    )
}
